	}
	this.handleSubmit = this.handleSubmit.bind(this);
  }

	handleSubmit ( event ) {
		  event.preventDefault();
		  console.log(' btn click', this.input.value)
		}

	handleInput(event){
		console.log(event.target.value)
	}

  render(){
    return (
    	<div>
			<form id = "contact-form"  onSubmit = {this.handleSubmit}>
